INSERT INTO `config` (`id`, `mission`, `vission`, `policy`) VALUES
(1, 'To produce and market excellent quality electrical wires and cables, provide customer satisfaction, generate sufficient profit/earnings to finance future expansions and meet investors maximum possible return on investment, and contribute to the progress of the community where it operates while maintaining safety and well-being of its employees.', 'To be recognized as the market leader in the Philippine wire and cable industry and become the preferred supplier of excellent quality electrical wires and cables of the major trading, construction, and electric power utility companies in the country.', 'American Wire &amp; Cable Co., Inc. is committed to consistently produce and market excellent quality electrical wires and cables that are compliant with internationally - accepted standards and government regulatory requirements, and to pursue continuous improvement that will delight customers beyond expectations.');
